import React from 'react';

const VideoDetail = ({selectedVideo}) => {
    console.log("Target: ", selectedVideo);
    if (!selectedVideo){
        <div>Loading...</div>
    }
    return(
        <div> Video Detail: {selectedVideo.snippet.title}</div>
    )
}

export default VideoDetail;
